    "# Bellabeat\n",
    "This report consists of 4 parts, applied the recommended phases from Google Data Analytics Course, as follow:\n",
    "* Introduction: summarize the report’s purposes, scenario, and background.\n",
    "* Problems: define the problems, later approach and analyze them through Ask, Prepare, Process, and Analyze Phases.\n",
