    "### 2.2 Prepare Phase\n",
    "This report used the data from Fitbit Fitness Tracker to find the trends and insights in the health smart device usage market. Then, applying these trends into the Bellabeat case to improve the performance.\n",
    "* Data Source\n",
    "    * FitBit Fitness Tracker Data on Kaggle, by Mobius.FitBit Fitness Tracker Data on Kaggle, by Mobius.\n",
    "* Description\n",
    "    * License: CC0: Public Domain\n",
    "    * This dataset was generated by respondents to a distributed survey via Amazon Mechanical Turk between 03.12.2016-05.12.2016.\n",
    "    * Thirty eligible Fitbit users consented to the submission of personal tracker data, including minute-level output for physical activity, heart rate, and sleep monitoring.\n",
    "* Observation\n",
    "    * The dataset was generated in 2016, which is not current. Therefore, the analysis results need to be considered carefully before applying into the current status.\n",
    "    * The size of the dataset may be a limitation as it only contains 30 users’ usage records."
   ]
  },
