    "# Convert to class date\n",
    "    # activity\n",
    "activity$ActivityDate = as.Date(activity$ActivityDate,format = \"%m/%d/%y\")\n",
    "    # calo\n",
    "calo$ActivityDay = as.Date(calo$ActivityDay,format = \"%m/%d/%y\")\n",
    "    # intensities\n",
    "intensities$ActivityDay = as.Date(intensities$ActivityDay,format = \"%m/%d/%y\")\n",
    "    # step\n",
    "step$ActivityDay = as.Date(step$ActivityDay,format = \"%m/%d/%y\")\n",
    "    # sleep\n",
    "sleep$SleepDay = as.Date(sleep$SleepDay,format = \"%m/%d/%y\")\n",
    "\n",
    "# Convert and split date time\n",
    "    #intensities_hour\n",
    "intensities_hour$ActivityHour = as.POSIXct (intensities_hour$ActivityHour,format=\"%m/%d/%Y %I:%M:%S %p\", tz=\"GMT\")\n",
    "intensities_hour$date <- as.Date(intensities_hour$ActivityHour, format=\"%m/%d/%Y\")\n",
    "intensities_hour$time <- format (intensities_hour$ActivityHour, format=\"%H:%M:%S\")\n",
    "    #calo_hour\n",
    "calo_hour$ActivityHour = as.POSIXct (calo_hour$ActivityHour, format=\"%m/%d/%Y %I:%M:%S %p\", tz=\"GMT\")\n",
    "calo_hour$date <- as.Date(calo_hour$ActivityHour, format=\"%m/%d/%Y\")\n",
    "calo_hour$time <- format (calo_hour$ActivityHour, format=\"%H:%M:%S\")"
   ]
  },
