   "source": [
    "**Observations**\n",
    "* Looking at the mean of intensity types\n",
    "    * We can see that the sedentary mean value (991 minutes ~ 16.5 hours) is extremely high. Users are characterized by much sitting (~16.5 out of 24 hours) and little physical exercise.\n",
    "    * Most of the users are lightly active category\n",
    "* Step total in a day\n",
    "    * The average is more than 7,500, which is pretty ideal. [The CDC recent research](http://www.cdc.gov/media/releases/2020/p0324-daily-step-count.html) shows that 8,000 steps a day can lower the risks of death of 51%.\n",
    "* Sleep\n",
    "    * Most users sleep approximately 7 hours a night. The number is also ideal because it's in the range of [CDC recommendation](https://www.cdc.gov/sleep/about_sleep/how_much_sleep.html) (adult 18 - 60 years old : 7 or more hours per night)"
   ]
