   "source": [
    "#Average intensities by time\n",
    "intensities_avg_by_time <- intensities_hour %>%\n",
    "  group_by(time) %>%\n",
    "  drop_na() %>%\n",
    "  summarise(mean_intensity = mean(TotalIntensity))\n",
    "\n",
    "#Average calories burnt by time\n",
    "calo_avg_by_time <- calo_hour %>%\n",
    "  group_by(time) %>%\n",
    "  drop_na() %>%\n",
    "  summarise(mean_calo = mean(Calories))"
   ]
