   "source": [
    "# Create a chart to help us understand the figures easier\n",
    "image01 <- ggplot (data = intensities_avg_by_time, aes (x=time,y=mean_intensity)) + \n",
    "geom_col(aes(x=time, y = mean_intensity, fill = mean_intensity)) +\n",
    "    theme(axis.text.x = element_text(angle = 90,color = \"blue\")) +\n",
    "    theme (axis.text.y = element_text (color = \"blue\")) +\n",
    "    labs(title=\"Image 01. Average Intensity By Time\")\n",
    "\n",
    "image02 <- ggplot (data = calo_avg_by_time, aes (x=time,y=mean_calo)) + \n",
    "geom_col(aes(x=time, y = mean_calo, fill = mean_calo)) +\n",
    "    theme(axis.text.x = element_text(angle = 90,color = \"blue\")) +\n",
    "    theme (axis.text.y = element_text (color = \"blue\")) +\n",
    "    labs(title=\"Image 02. Average Calo By Time\")\n",
    "\n",
    "image01\n",
    "image02"
   ]
  },
