   "source": [
    "**Observations**\n",
    "* Both the visualizations show that there are \n",
    "    * an stable increase trend during day time (8:00 - 16:00)\n",
    "    * a slightly drop in the time of 15:00\n",
    "    * peak at evening around the time of 17:00 - 19:00\n",
    "    \n",
    "A drop appeared may be a result of the afternoon breaks, which is pretty understandble -> **Bellabeat should limit the notifications of products during this time to avoid interupting user relaxation -> Better user experience.**\n",
    "\n",
    "The most active time is 17:00 - 19:00 -> **Bellabeat can utilize this info to remind people to have healthy activities, such as running, gym, etc.**"
   ]
