   "source": [
    "#Explore the sleep pattern, are there any strange things happen?\n",
    "\n",
    "sleep$weekday <- wday(sleep$SleepDay, label=TRUE)\n",
    "\n",
    "sleep_avg_by_weekday <- sleep %>%\n",
    "  group_by(weekday) %>%\n",
    "  summarise(mean_sleep_weekday = mean(TotalMinutesAsleep))\n",
    "\n",
    "sleep_avg_by_weekday\n",
    "\n",
    "#Explore which day in the week that people most active, are there any strange things happen?\n",
    "calo$weekday <- wday(calo$ActivityDay, label=TRUE)\n",
    "\n",
    "calo_avg_by_weekday <- calo %>%\n",
    "  group_by(weekday) %>%\n",
    "  summarise(mean_calo_weekday = mean(Calories))\n",
    "\n",
    "calo_avg_by_weekday"
   ]
