   "source": [
    "#### **3.2.2 Marketing Strategy Suggestion**\n",
    "\n",
    "**Target Market**\n",
    "* Object: Women who do care about their health status that have a little time on excercises. Besides, they may be office workers in companies and organizations.\n",
    "* Reasons: \n",
    "    * They spend money on using the health tracker products.\n",
    "    * Most of them are lightly active category.\n",
    "    * The sedentary mean value is around 16.5 hours.\n",
    "* Needs & Wants:\n",
    "    * They may need useful recommendations & tips for improving health with the reasonable time spent.\n",
    "    * Further features may be needed to develop for motivating healthy habits of users.\n",
    "    \n",
    "**Ideas**\n",
    "1. Set the recommended stesps (CDC research shows 8.000 steps/day) taking a day for users -> They'll acknowledge the daily goal and current status to adjust their activites.\n",
    "\n",
    "2. All the notifications of Bellabeat's products during 14:00 - 15:00 should be limited -> Improve user experience as people don't want to be interupted in lunch breaks.\n",
    "\n",
    "3. Bellabeat can send a reminder in 17:00 - 19:00 to annouce users having exercises, gym, runnings, etc. (because this is the most active time in day - based on the average intensity and calo by time) -> Motivae healthy habits of users.\n",
    "\n",
    "4. The content team can generate light and brief exercises to recommend for users because they may not have enough time for long and official exercises (data shows the lightly active category).\n",
    "\n",
    "5. Because of the correlation between sleeping time and in-bed time, Bellabeat can recommend users go to in bed earlier, so that they can have a ealier sleeping time.\n",
    "\n",
    "6. Company can send notifications suggesting active activities during daytime to reduce the sedentary time -> People can get a better sleeping time -> Improving relaxation quality and users' health (the negative correlation between sleeping time and sedentary time).\n",
    "\n",
    "7. A feature to send warnings if the sedentary time reaches the unhealthy rate."
